import React from 'react';
import Header from '../components/Header';

const LoginPage = () => {
  return (
    <div>
      <Header />
      <div style={{ padding: '4rem 2rem', minHeight: '60vh', display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
        <div style={{ width: '100%', maxWidth: '400px', padding: '2rem', border: '1px solid #ddd', borderRadius: '10px' }}>
          <h2 style={{ textAlign: 'center', marginBottom: '2rem' }}>Login</h2>
          <form>
            <div style={{ marginBottom: '1rem' }}>
              <input 
                type="email" 
                placeholder="Email" 
                style={{ width: '100%', padding: '0.8rem', border: '1px solid #ccc', borderRadius: '5px' }}
              />
            </div>
            <div style={{ marginBottom: '1rem' }}>
              <input 
                type="password" 
                placeholder="Password" 
                style={{ width: '100%', padding: '0.8rem', border: '1px solid #ccc', borderRadius: '5px' }}
              />
            </div>
            <button 
              type="submit"
              style={{ width: '100%', padding: '0.8rem', background: '#007bff', color: 'white', border: 'none', borderRadius: '5px' }}
            >
              Login
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
